## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a new file called TooltipContext.js and add the following code to it.
```
import { createContext } from "react";

const TooltipContext = createContext();

export default TooltipContext;
```
### Step 2: Create a Tooltip Context Provider

Create a new file called TooltipProvider.js and add the following code to it.
```
import { useState } from "react";
import TooltipContext from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Step 3: Create a Tooltip Component

Create a new file called Tooltip.js and add the following code to it.
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = ({ children, tooltipText }) => {
  const { tooltip, setTooltip } = useContext(TooltipContext);

  return (
    <div>
      {children}
      {tooltip === tooltipText && (
        <div className="tooltip">
          <p>{tooltipText}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
### Step 4: Create a Tooltip Button Component

Create a new file called TooltipButton.js and add the following code to it.
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const TooltipButton = ({ children, tooltipText }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div>
      <button
        onClick={() => {
          setTooltip(tooltipText);
        }}
      >
        {children}
      </button>
    </div>
  );
};

export default TooltipButton;
```
